function Contact(){
    return (
        <div className="contact">
          <h3>Contact</h3>
          <p><a style={{textDecoration:"none", color:"black"}} href="https://github.com/swojas" target="_blank" rel="noopener noreferrer">GitHub: <i class="fab fa-github"></i></a></p>
          <p><a style={{textDecoration:"none", color:"black"}} href = "mailto: swojas12@gmail.com">Email: ✉️</a></p>
          <p><a style={{textDecoration:"none", color:"black"}} href = "https://www.linkedin.com/in/swojas-bhalunkar-225a8914a/" target="_blank" rel="noopener noreferrer">LinkedIn: <i class="fab fa-linkedin"></i></a></p>
        </div>
    );
}

export default Contact;
